erver has issues or you make a mistake in mail configuration.'=>'Contact Form 7 не складишти примљене поруке. Самим тим, уколико ваш сервер за е-пошту има неке проблеме или ако направите неке грешке у поставкама е-поште, можете заувек изгубити важне поруке.','Before you cry over spilt mail&#8230;'=>'Пре него што заплачете над просутом е-поштом&#8230;','https://contactform7.com/comment-blacklist/'=>'https://contactform7.com/comment-blacklist/','Spammers target everything; your contact forms are not an exception. Before you get spammed, protect your contact forms with the powerful anti-spam features Contact Form 7 provides.'=>'Спамери циљају на све; ваши контакт обрсаци нису изузетак. Заштите своје контакт обрасце моћним анти-спам функционалностима које пружа Contact Form 7 пре него што примите нежељену пошту.','Getting spammed? You have protection.'=>'Добијате нежељене поруке? Имате заштиту.','Multiple form controls are in a single label element.'=>'Вишеструке контроле образаца су смештене унутар oзнаке јединственог елемента.','FAQ about Configuration Validator'=>'Информације о валидатору конфигурације','https://contactform7.com/configuration-validator-faq/'=>'https://contactform7.com/configuration-validator-faq/','The answer to the quiz is incorrect.'=>'Одговор на упитник је нетачан.','There was an error uploading the file.'=>'Постојала је грешка током отпремања датотеке.','You are not allowed to upload files of this type.'=>'Није вам дозвољено да отпремите фајл овог типа.','There was an unknown error uploading the file.'=>'Постојала је непозната грешка током отпремања фајла.','You must accept the terms and conditions before sending your message.'=>'Морате прихватити услове пре слања ваше поруке.','One or more fields have an error. Please check and try again.'=>'Једно или више поља има грешку. Молим вас проверите и покушајте поново.','There was an error trying to send your message. Please try again later.'=>'Дошло је до грешке покушавајући да пошаљемо вашу поруку. М