ума који је пошиљалац унео је нетачан.','Field type'=>'Тип поља','radio buttons'=>'радио дугмад','checkboxes'=>'чекбокс','This contact form contains CAPTCHA fields, but the necessary libraries (GD and FreeType) are not available on your server.'=>'Овај формулар за контакт садржи поља CAPCHA, али на серверу немате инсталиране потребне библиотеке (GD или FreeType)','This contact form contains CAPTCHA fields, but the temporary folder for the files (%s) does not exist or is not writable. You can create the folder or change its permission manually.'=>'Овај формулар за контакт садржи CAPTCHA поља, али привремени директоријум за датотеке (%s) не постоји или није уписив. Можете направити директоријум или ручно променити права приступа.','Your entered code is incorrect.'=>'Унели сте погрешан кôд.','The code that sender entered does not match the CAPTCHA'=>'Кôд који је унео пошиљалац не одговара CAPTCHA кôду','Insert Tag'=>'Унеси ознаку.','Class attribute'=>'Атрибут класе','Acceptance checkbox'=>'Поље за потврду прихватања','acceptance'=>'Прихватање','<code>%1$s</code> property of a <code>WPCF7_ContactForm</code> object is <strong>no longer accessible</strong>. Use <code>%2$s</code> method instead.'=>'<code>%1$s</code> особина <code>WPCF7_ContactForm</code> објекта <strong>није више доступна</strong>. Користите радије <code>%2$s</code> методу.','Untitled'=>'Без наслова','Contact Form'=>'Контакт форма','There is a field with input that is shorter than the minimum allowed length'=>'У пољу се налази унос који је краћи од дозољеног минимума ','There is a field with input that is longer than the maximum allowed length'=>'У пољу се налази унос који је дужи од дозољеног максимума','There is a field that the sender must fill in'=>'Постоје поља која пошиљалац мора испунити.','There are terms that the sender must accept'=>'Постоје услови које би пошиљалац требало да прихвати','Submission was referred to as spam'=>'Послати подаци се сматрају непожељним садржајем','Validation errors occurred'=>'Дошло је до грешке при провери','Message Body:'=>'Садржај поруке:','Subject: %s'=>'Предмет: %s','From: %s'=>'Од: %s','Send'=>'Пошаљи','Your message'=>'Ваша порука','Your email'=>'Ваша е-пошта','Your name'=>'Ваше име','Form-tag Generator: %s'=>'Ознака-формулара Генератор: %s','For more information:'=>'За више информација:','Any information you provide will not be shared with service providers without your authorization.'=>'Све информације које сте послали неће се делити са пружаоцем услуге без ваше сагласности. ','You may need to first sign up for an account with the service that you plan to use. When you do so, you would need to authorize Contact Form 7 to access the service with your account.'=>'Морате прво да направите налог са услугом коју планирате да користите.Када то урадите,морате да овластите Контакт Формулар 7 да приступи сервису са Вашим налогом.','On this screen, you can manage services that are available through Contact Form 7. Using API will allow you to collaborate with any services that are available.'=>'На овом екрану,можете управљати сервисима који су доступни кроз Контакт Форму 7.Коришћење АПИ-ја  ће Вам дозволити  да сарађујете са било којим сервисима који су доступни.','There are also special mail-tags that have specific names, but do not have corresponding form-tags. They are used to represent meta information of form submissions like the submitter&#8217;s IP address or the URL of the page.'=>'Ту су и посебне ознаке за пошту са специфичним именима, али немају одговарајуће образац-ознаке. Користе се за представљање мета информација о предатим обрасцима, као што су IP адреса предавача или URL странице.','A mail-tag is also a short code enclosed in square brackets that you can use in every Mail and Mail (2) field. A mail-tag represents a user input value through an input field of a corresponding form-tag.'=>'Ознака за пошту је такође кратак код у угластим заградама које можете користити у сваком пољу поште и пољу поште(2).Ознака за пошту представља корисничку унету вредност кроз поље уноса одговарајуће ознаке формулара.','A form-tag is a short code enclosed in square brackets used in a form content. A form-tag generally represents an input field, and its components can be separated into four parts: type, name, options, and values. Contact Form 7 supports several types of form-tags including text fields, number fields, date fields, checkboxes, radio buttons, menus, file-uploading fields, CAPTCHAs, and quiz fields.'=>'Формулар-ознака је кратак код у угластим заградама који се користи у садржају формулара. Формулар-ознака обично представља поље за унос, и његове компоненте могу бити раздвојене на четири дела: врсте, назив, опције и вредности.Контакт Форм 7 подржава подржава неколико врста ознака формулара укључујући текстуална поља, број поља, поље са датумом,чекбоксове,радио дугмад,меније,поља за отпремање фајлова,CAPTCHAs,и поља за квизове.','<strong>Additional Settings</strong> provides a place where you can customize the behavior of this contact form by adding code snippets.'=>'<strong>Додатна Подешавања</strong>  омогућава место где можете прилагодити понашање контактног формулара тако што ћете додати фрагменте кода.','In <strong>Messages</strong>, you can edit various types of messages used for this contact form. These messages are relatively short messages, like a validation error message you see when you leave a required field blank.'=>'У <strong>Поруке</strong>, можете уредити различите типове порука које се користе у овом контакт формулару. Ово су релативно кратке поруке, као што је порука грешке при валидацији која се види када обавезно поље остане празно.','<strong>Mail (2)</strong> is an additional mail template that works similar to Mail. Mail (2) is different in that it is sent only when Mail has been sent successfully.'=>'<strong>Порука (2)</strong> је додатни шаблон поруке који ради слично шаблону Порука. Порука (2) се разликује по томе што се шаље тек кад је Порука успешно послата.','<strong>Mail</strong> manages a mail template (headers and message body) that this contact form will send when users submit it. You can use Contact Form 7&#8217;s mail-tags here.'=>'<strong>Порука</strong> управља подацима поруке(заглавље и тело поруке) које ће овај контактни формулар послати када је корисник достави. Можете користити контактни формулар 7&#8217;s са ознакама порука овде.','<strong>Form</strong> is a content of HTML form. You can use arbitrary HTML, which is allowed inside a form element. You can also use Contact Form 7&#8217;s form-tags here.'=>'<strong>Формулар</strong> је садржај HTML формулара. Можете користити произвољан HTML, који је дозвољен унутар елемента формулара. Може се такође користити CF7 као ознака формулара овде.  ','<strong>Title</strong> is the title of a contact form. This title is only used for labeling a contact form, and can be edited.'=>'<strong>Назив</strong> је назив контакт форме. Наслови се користи само за именованје контакт форме и може се променити.','On this screen, you can edit a contact form. A contact form is comprised of the following components:'=>'У овом прозору, можете уређивати садржајну форму.Садржајна  је сачињена од следећих компоненти:','<strong>Duplicate</strong> - Clones that contact form. A cloned contact form inherits all content from the original, but has a different ID.'=>'<strong>Duplicate</strong> - Клонира дату садржајну форму. Клонирана садржајна форма наслеђује садржај оригналне, али има другачију идентификацију.','<strong>Edit</strong> - Navigates to the editing screen for that contact form. You can also reach that screen by clicking on the contact form title.'=>'<strong>Edit</strong> - Наводи до краја прозора за дату садржајну форму. Такође можете достићи тај прозор кликом на назив садржајне форме.','Hovering over a row in the contact forms list will display action links that allow you to manage your contact form. You can perform the following actions:'=>'Преласком миша преко реда у листи садржајне форме ће приказати акционе линкове који вам дозвољавају да управљате својом садржајном формом. Можете извршити следеће акције:','On this screen, you can manage contact forms provided by Contact Form 7. You can manage an unlimited number of contact forms. Each contact form has a unique ID and Contact Form 7 shortcode ([contact-form-7 ...]). To insert a contact form into a post or a text widget, insert the shortcode into the target.'=>'На екрану, можете да упревљате садржајним формама које предвиђа Contact Form 7.Можете да управљате неограниченим бројем садржајних форми. Свака садржајна форма има јединствену идентификацију и Contact Form 7 кратки код ([contact-form-7 ...]).Да би убацили садржајну форму у пост или текстуални widget, убаците кратки код у одредиште.','Mail-tags'=>'Тагови за поруке','Form-tags'=>'Тагови форми','Available Actions'=>'Могуће акције.','Overview'=>'Преглед','You can add customization code snippets here. For details, see %s.'=>'Можете додати прилагођавање кода фрагмената овде. За детаље , погледајте %s.','https://contactform7.com/additional-settings/'=>'https://contactform7.com/additional-settings/','File attachments'=>'Прилози','Use HTML content type'=>'Користи HTML врсту садржаја','Exclude lines with blank mail-tags from output'=>'Искључити линије са излаза  са празном ознаком поште ','Message body'=>'Тело поруке','Additional headers'=>'Додатна заглавља','Subject'=>'Предмет','From'=>'Од','To'=>'За','In the following fields, you can use these mail-tags:'=>'У следећим пољима, можеш да користиш ове ознаке за поруку:','Mail (2) is an additional mail template often used as an autoresponder.'=>'Пошта (2) је додатни шаблон поште често коришћен као аутоматски одговор.','Use Mail (2)'=>'Користити пошту (2)','Mail (2)'=>'Пошта (2)','Y/m/d'=>'Y/m/d','Edit &#8220;%s&#8221;'=>'Уреди &#8222;%s&#8220;','Edit'=>'Уреди','Date'=>'Datum','Author'=>'Autor','Shortcode'=>'Кратак код','Title'=>'Naslov','Additional Settings'=>'Допунске поставке','Additional Settings (%d)'=>'Додатна подешавања (%d)','Messages'=>'Поруке','Mail'=>'Пошта','Form'=>'Формулар','Support'=>'Подршка','https://contactform7.com/support/'=>'https://contactform7.com/support/','FAQ'=>'ЧПП','https://contactform7.com/faq/'=>'https://contactform7.com/faq/','Docs'=>'Документација','https://contactform7.com/docs/'=>'https://contactform7.com/docs/','Delete'=>'Уклони','Duplicate'=>'Дуплирај','Status'=>'Status','You can also use this old-style shortcode:'=>'Може се користити такође и овај кратак код старог стила:','Copy this shortcode and paste it into your post, page, or text widget content:'=>'Копирај овај кратки код и налепи на свој чланак, страницу, или као садржај текстуалног виџета:','Enter title here'=>'Унети наслов овде','Save'=>'Сачувај','You are not allowed to edit this contact form.'=>'Није дозвољено да мењате садржај контакт форме.','https://contactform7.com/save-submitted-messages-with-flamingo/'=>'https://contactform7.com/save-submitted-messages-with-flamingo/','Spam filtering with Akismet'=>'Филтрирање спама са Акисметом','https://contactform7.com/spam-filtering-with-akismet/'=>'https://contactform7.com/spam-filtering-with-akismet/','Setting up mail'=>'Подешавања е-поруке','https://contactform7.com/setting-up-mail/'=>'https://contactform7.com/setting-up-mail/','Contact Form 7 needs your support.'=>'Контакт формулару 7 је потребна ваша подршка.','Dismiss'=>'Откажи','<strong>Contact Form 7 %1$s requires WordPress %2$s or higher.</strong> Please <a href="%3$s">update WordPress</a> first.'=>'<strong>Контакт формулар 7 %1$s захтева Вордпрес %2$s или новији.</strong> Прво <a href="%3$s">ажурирајте Вордпрес</a>.','Settings'=>'Поставке','Contact form deleted.'=>'Формулар за контакт је уклоњен.','Contact form saved.'=>'Формулар за контакт је сачуван.','Contact form created.'=>'Формулар за контакт је направљен.','Search Contact Forms'=>'Претражи контакт формуларе','Error in deleting.'=>'Грешка у брисању.','You are not allowed to delete this item.'=>'Није вам 